INSERT INTO `v1_7aade9d2ca7a8c1ff6a45d8eccde7da129a491b3a755c16e014d6727b2f27a96` VALUES (1110501043, 111011, 1, 1, "この蝋燭は、もしや君が作ったのか？\nなに、精油にそんな希少な成分を？\nわざわざぼくの誕生日を祝うために？\n後輩……君という子は……！", "", 0, 11, 4, 1110501, 0);
